;; **
;;; # Arithmetic functions induction
;;; 
;;; We're going to define a structured regression problem. In regression problems, we wish to learn an explicit functional relationship between _inputs_ and _outputs_.
;;; 
;;; Here we explore using a generative model for functions. This lets us explicitly encode what sorts of functions we may wish to learn. In this exercise we focus on learning _arithmetic functions_ of a single argument, composed of integers, and simple operations of `+`, `-`, `*`, and `/`.
;; **

;; @@
(ns arithmetic-functions-induction
   (:require [gorilla-plot.core :as plot]
             [clojure.repl :as repl]
             [anglican.runtime :refer [sample* observe* flip uniform-discrete discrete normal log exp abs]]))

(def log-prob observe*)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-induction/log-prob</span>","value":"#'arithmetic-functions-induction/log-prob"}
;; <=

;; **
;;; We start by defining a list of possible operations.
;; **

;; @@
;; We use `safe-div` to prevent possible division by zero exceptions.

(defn safe-div [x y] (if (zero? y) 0 (/ x y)))

(def operations ['+ '- '* 'safe-div])

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-induction/operations</span>","value":"#'arithmetic-functions-induction/operations"}
;; <=

;; **
;;; We'll start with a very simple class of functions: let's just consider functions of the form `(fn [x] (f a b))`  where `f` is a function, and `a` and `b` are each either a numeric constant, or `x`.
;;; 
;;; We'll write down a generative model for the body of such functions.
;; **

;; @@
(defn get-int-constant [] 
  (sample* (uniform-discrete 0 10)))

(defn sample-operation [] 
  (get operations (sample* (uniform-discrete 0 (count operations)))))

(defn sample-symbol []
  (if (sample* (flip 0.6)) (get-int-constant) 'x))

(defn sample-simple []
  (list (sample-operation) (sample-symbol) (sample-symbol)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-induction/sample-simple</span>","value":"#'arithmetic-functions-induction/sample-simple"}
;; <=

;; **
;;; If we draw a sample from this model, we get the body of a function:
;; **

;; @@
(clojure.pprint/pprint (repeatedly 10 sample-simple))
;; @@
;; ->
;;; ((+ 6 5)
;;;  (* x 3)
;;;  (+ x x)
;;;  (* 1 3)
;;;  (+ x x)
;;;  (+ 1 0)
;;;  (* 8 x)
;;;  (+ x 0)
;;;  (+ 8 x)
;;;  (- x 1))
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; We can make these into explicit quoted Clojure functions as below, and use `eval` to execute the function.
;; **

;; @@
(defn make-fn [body-expr]
  (list 'fn ['x] body-expr))


(let [example-fn (make-fn (sample-simple))]
  (println example-fn)
  (println "evaluated at x=5:" ((eval example-fn) 5)))


;; @@
;; ->
;;; (fn [x] (+ 2 7))
;;; evaluated at x=5: 9
