;; **
;;; This is a generative model which only admits very simple functions.
;;; 
;;; In addition to writing this sampler, which draws from the generative model, we also want to write a function which _scores_ functions according to the model. That is, we need to compute @@\ln p(f)@@, where @@f@@ is a function expression.
;;; 
;;; Generally, the function which computes the score of an expression is like the function we used to generate the expression, only instead of using `sample` to generate a new random value, we use `log-prob` to evaluate the probability of a fixed value.
;; **

;; @@
(defn score-operation 
  "each of the operations has the same (fixed) probability, independent of the operation"
  [op]
  (log (/ 1. (count operations))))

(defn score-symbol 
  "the symbol 'x has probability 0.4; each of the 10 integer constants has 
   equal probability 0.6 * 0.1 = 0.06"
  [sym]
  (log (if (number? sym) 0.06 0.4)))


(defn score-simple [expr]
  (let [[op sym1 sym2] expr]
    (+ (score-operation op) (score-symbol sym1) (score-symbol sym2))))

