;; **
;;; Now, we would like to perform _inference_: we condition on a possible output from the generative model, and characterize the distribution over the latent variables.
;;; 
;;; For example: what would happen if we wanted to restrict to functions for which we (at least approximately) have @@f(2) = 4@@?
;;; 
;;; We do this by considering not just the _prior_, the generative model over expressions, but also a _likelihood_, which links the generative model to the data.
;;; 
;;; For example, we could express "@@f(2)@@ is approximately @@4@@" by a likelihood term which follows a normal distribution. We have _data_, @@y = 4@@, and some function @@f@@ we sample from our generative model, and we could say
;;; 
;;; \begin{align}
;;; \mu &= f(2) \\\\
;;; \sigma &= 0.05 \times f(2) \\\\
;;; p(y=4 | f) &= \mathrm{Normal}(y=4 | \mu, \sigma )
;;; \end{align}
;;; 
;;; where the normal distribution is parameterized by a mean and a standard deviation. 
;;; 
;;; We can sample from this generative model, which includes the "noise" in the likelihood. We will also need to evaluate the likelihood later.
;;; 
;; **

;; @@
(defn get-sigmas [values]
  (mapv (fn [v] (max 0.001 (abs (* 0.05 v)))) values))

(defn sample-likelihood [inputs]
  (mapv (fn [mu sigma] (sample* (normal mu sigma))) inputs (get-sigmas inputs)))

(defn score-likelihood [inputs outputs]
  (mapv (fn [in out sigma] (log-prob (normal in sigma) out)) inputs outputs (get-sigmas inputs)))

(defn plot-joint-samples [f]
  (let [domain (range -10 11 0.15)
        ef (eval f)]
        ;noisy-function (fn [x] (sample-likelihood (ef x)))]
    (println f)
    (plot/list-plot (map list domain (sample-likelihood (mapv ef domain))) :joined true :x-title (str f))))


(repeatedly 10 #(plot-joint-samples (make-fn (sample-simple))))
