(defn sample-independent-proposal [prev] (sample-simple))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-induction/sample-independent-proposal</span>","value":"#'arithmetic-functions-induction/sample-independent-proposal"}
;; <=

;; **
;;; Now, we define the MH transition function below.
;; **

;; @@
(defn make-mh-transition [proposal]
  (fn mh-transition [prev-expr inputs outputs]
    (let [; compute p(f, y)
          prev-fn-vals (mapv (eval (make-fn prev-expr)) inputs)
          ;_ (println (score-likelihood prev-fn-vals outputs))
          prev-score (+ (score-simple prev-expr) (reduce + (score-likelihood prev-fn-vals outputs)))
          ; propose new f' from q(f' | f)
          next-expr (sample-simple-proposal prev-expr)
          ; compute p(f', y)
          next-fn-vals (mapv (eval (make-fn next-expr)) inputs)
          next-score (+ (score-simple next-expr) (reduce + (score-likelihood next-fn-vals outputs)))
          accept-ratio (exp (- next-score prev-score))]
      (if (sample* (flip accept-ratio))
        [next-expr next-score]
        [prev-expr prev-score]))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-induction/make-mh-transition</span>","value":"#'arithmetic-functions-induction/make-mh-transition"}
;; <=

;; @@
(def mh-transition-simple (make-mh-transition sample-simple-proposal))

(def mh-transition-independent (make-mh-transition sample-independent-proposal))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-induction/mh-transition-independent</span>","value":"#'arithmetic-functions-induction/mh-transition-independent"}
;; <=

;; **
;;; Now, define a function to run the MH sampler for a given number of samples, which takes `input` and `output` sequences as input.
;; **

;; @@
(defn run-mh-sampler [mh-transition inputs outputs num-samples]
  (let [init-expr (sample-simple)]
    (loop [samples []
           scores []
           prev-expr init-expr]
      (if (> (count samples) num-samples)
        {:samples samples :scores scores}
        (let [[next-expr next-score] (mh-transition prev-expr inputs outputs)]
          (recur (conj samples next-expr)
                 (conj scores next-score)
                 next-expr))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-induction/run-mh-sampler</span>","value":"#'arithmetic-functions-induction/run-mh-sampler"}
;; <=

;; @@
(time (def posterior (run-mh-sampler mh-transition-simple [2] [4] 1000)))
