;; **
;;; ## More complex functions
;;; 
;;; Now let's consider a broader class of functions. We'll build out more complicated functions compositionally: previously we considered functions of the form `(f a b)`, where `a` and `b` were either integers or `x`. We can expand the sort of functions we write by allowing `a` and `b` to themselves be other functions.
;;; 
;;; Let's specifically consider a model where each `a` or `b` may be expanded in one of three ways:
;;; 
;;; * to the symbolic function argument `x`, with probability 0.3;
;;; * to an integer uniform in @@0, \dots, 9@@, with probability 0.4 (i.e., with probability 0.04 for any particular integer);
;;; * to a new function of the same form `(f a b)`, with probability 0.3.
;;; 
;;; The most straightforward way to write a sampler which draws functions from this generative model is by using a recursive function.
;; **

;; @@
(defn sample-expr []
  (let [expression-type (sample* (discrete [0.3 0.4 0.3]))]
    (cond (= expression-type 0) 'x
          (= expression-type 1) (get-int-constant)
          :else 
          (let [operation (get operations (sample* (uniform-discrete 0 (count operations))))]
            (list operation (sample-expr) (sample-expr))))))


(defn sample-function []
  (list (sample-operation) (sample-expr) (sample-expr)))

