;; <=

;; **
;;; ### Learning approximations to non-analytic functions
;; **

;; **
;;; For a more interesting example: what if we try to learn an approximation to a function which has no analytic form?
;;; 
;;; For example, how about learning an approximation to @@e^x@@?
;;; 
;;; We construct "training data" by evaluating @@e^x@@ along a grid.
;; **

;; @@
(def inputs-exp (range -10 10 1))
(def outputs-exp (mapv exp inputs-exp))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-induction/outputs-exp</span>","value":"#'arithmetic-functions-induction/outputs-exp"}
;; <=

;; @@
(time (def posterior-independent-proposals 
        (run-mh-sampler mh-independent-proposals inputs-exp outputs-exp 20000)))
;; @@
;; ->
;;; &quot;Elapsed time: 39321.468 msecs&quot;
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-induction/posterior-independent-proposals</span>","value":"#'arithmetic-functions-induction/posterior-independent-proposals"}
;; <=

;; @@
(def approximations-to-exp (into #{} (drop 10000 (:samples posterior-independent-proposals))))

(clojure.pprint/pprint approximations-to-exp)
;; @@
;; ->
;;; #{(- 1 (* (* x (- x (* 8 (safe-div x 1)))) x))
;;;   (+ (* (* x (- (* x x) 8)) 9) 2)}
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(for [func (take 10 approximations-to-exp)]
  (do
    (plot/compose
      (plot-function (make-fn func))
      (plot/list-plot (map list inputs-exp outputs-exp)))))
