;; **
;;; ### A better proposal
;;; 
;;; **ADVANCED EXERCISE**
;;; 
;;; Ideally, instead of proposing independently, we would have a proposal distribution which suggests small perturbations to existing functions.
;;; 
;;; One version of a proposal for this model goes as follows: Suppose `f` is the body of some current sampled function. This function can be represented (visually) as a tree: each of the two sub-expressions is itself either a _terminal symbol_ (i.e. a number or `x`), or another function.
;;; 
;;; For example, the function `(fn [x] (+ (* 2 x) (* (- x 1) x)))` can be diagrammed as
;;; 
;;; ```
;;;       +
;;;   *       *
;;;  2 x    -   x
;;;        x 1
;;; 
;;; ```
;;; 
;;; We can make proposals by picking any one of the nodes in this tree, at random, and then changing its value. The sorts of transistions we can consider are things along the lines of the following:
;;; 
;;; 1. Pick an operation at random, and change it to a different operation
;;; 1. Pick a terminal symbol at random (i.e. an integer or `x`), and change it at random to a different terminal symbol
;;; 1. Expand the tree one step: Pick a terminal symbol at random, and replace it with a new sub-expression of the form `(f T T)`, where `T` is a terminal
;;; 1. Contract the tree one step: Pick a sub-expression with no nesting at random, and replace it with a single terminal symbol
;;; 
;;; The first two of these operations of straightforward. The second two are complicated, as they change the number of random variables in the expression.
;;; 
;;; **EXERCISE** For each of these operations, what is @@q(f' | f)@@?.
;;; 
;;; **EXERCISE** Design an efficient MH transition operator for this model
;; **

;; **
;;; Let @@P@@ and @@P'@@ denote the number of operations in @@f@@ and @@f'@@, and let @@T@@ and @@T'@@ denote the number of terminal symbols. Recall @@p(\mathrm{number}) = 0.04@@ for any number @@0,\dots,9@@ and @@p(x) = 0.3@@.
;;; 
;;; Denote by @@p(\mathrm{terminal})@@ the probability of sampling some particular terminal (either a number, or `x`). This has @@p(\mathrm{terminal} = \mathrm{number}) = 0.04/0.7@@ for any individual number, and @@p(\mathrm{terminal} = x) = 0.3/0.7@@.
;;; 
;;; 1. @@q\_1(f' | f) = \frac{1}{P} p(\mathrm{operation})@@
;;; 2. @@q\_2(f' | f) = \frac{1}{T} p(\mathrm{terminal})@@
;;; 3. Proposing a new sub-expression, where each of the arguments are themselves terminals, has @@q\_3(f' | f) = \frac{1}{T} p(\mathrm{operation}) p(\mathrm{terminal}_1) p(\mathrm{terminal}_2)@@
;;; 4. Let @@E@@ and @@E'@@ denote the number of sub-expressions with `(f T T)`. Then @@q\_4(f' | f) = \frac{1}{E} p(\mathrm{terminal})@@.
